package com.dynatrace.research.shufflebench.consumer;


/**
 * Event generated by a {@link StatefulConsumer}.
 */
public class ConsumerEvent {
  private byte[] data;

  public ConsumerEvent() {
  }

  public ConsumerEvent(byte[] data) {
    this.data = data;
  }

  public byte[] getData() {
    return data;
  }

  public void setData(byte[] data) {
    this.data = data;
  }
}
